    function distance(lat1, lon1, lat2, lon2){
        const R = 6371;
        const dLat = (lat2-lat1)*Math.PI/180;
        const dLon = (lon2-lon1)*Math.PI/180;
        const a = Math.sin(dLat/2)**2 +
                  Math.cos(lat1*Math.PI/180)*Math.cos(lat2*Math.PI/180) *
                  Math.sin(dLon/2)**2;
        return R * 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
    }

    function updatePosition(pos){
        var lat = pos.coords.latitude;
        var lon = pos.coords.longitude;

        if(!userMarker){
            userMarker = L.marker([lat, lon]).addTo(map)
                .bindPopup("üìç Tu ubicaci√≥n").openPopup();
        } else {
            userMarker.setLatLng([lat, lon]);
        }

        if(!accuracyCircle){
            accuracyCircle = L.circle([lat, lon], {
                radius: pos.coords.accuracy,
                color:"red",
                fillOpacity:0.15
            }).addTo(map);
        } else {
            accuracyCircle.setLatLng([lat, lon])
                          .setRadius(pos.coords.accuracy);
        }

        var minD = Infinity;
        var nearest = null;
        stations.forEach(function(s){
            var d = distance(lat, lon, s.lat, s.lon);
            if(d < minD){ minD = d; nearest = s; }
        });

        if(nearest){
            geoBanner.innerHTML =
              '‚úÖ Geolocalizaci√≥n activada - Estaci√≥n m√°s cercana: ' +
              nearest.name + ' (' + minD.toFixed(2) + ' km)';

            if(nearestMarker) map.removeLayer(nearestMarker);
            if(nearestLine) map.removeLayer(nearestLine);

            nearestMarker = L.circleMarker(
                [nearest.lat, nearest.lon],
                {
                    radius:10,
                    color:"red",
                    fillColor:"yellow",
                    fillOpacity:1
                }
            ).addTo(map)
             .bindPopup(
               "‚≠ê Estaci√≥n m√°s cercana<br><b>" +
               nearest.name + "</b><br>" +
               minD.toFixed(2) + " km"
             );

            nearestLine = L.polyline(
                [[lat, lon],[nearest.lat, nearest.lon]],
                {color:"red", dashArray:"5,5"}
            ).addTo(map);
        }
    }

    if(navigator.geolocation){
        navigator.geolocation.watchPosition(
            updatePosition,
            function(err){ alert("No se pudo obtener la ubicaci√≥n: " + err.message); },
            { enableHighAccuracy:true }
        );
    }

    geoBtn.onclick = function(){
        if(userMarker){
            map.setView(userMarker.getLatLng(), 14);
        }
    };
